let vardisplay={run:()=>{const a=document.getElementsByTagName("html")[0],b=a.innerHTML.match(/({{(.*?)}})/g);for(let c=0;c<b.length;c++){const d=b[c],e=d.match(/([\<\>\=\;\$\(\)\,\/])/g);if(!e){const f=d.replace(/([{}<>\/\\\\=;$(),]*)/g,"");try{const g=eval(f);a.innerHTML=a.innerHTML.replace(d,g)}catch(e){}}}return"OK"},render:keyword=>{const a=document.getElementsByTagName("html")[0],r=new RegExp(`{{${keyword}}}`,"g"),b=a.innerHTML.match(r);if(!b||0==b.length)return!1;for(let c=0;c<b.length;c++){const d=b[c],e=d.match(/([\<\>\=\;\$\(\)\,\/])/g);if(!e){const f=d.replace(/([{}<>\/\\\\=;$(),]*)/g,"");try{const g=eval(f);return a.innerHTML=a.innerHTML.replace(d,g),!0}catch(e){return!1}}}}};vardisplay.run();